import React from 'react';
import Navigation from '../components/Navigation';

const Login = () => {
  return (
    <>
      <Navigation
        Title="Login"
        Links={[
          {
            title: 'Home',
            ref: '/'
          }
        ]}
      />
    </>
  );
};

export default Login;
